import React from 'react';
import './Style.css';

function Navbar() {
  return (
    <nav class="navbar navbar-expand-sm navbar-dark bg-dark navbar-sm">
  <ul class="navbar-nav mr-auto">
      <li class="nav-item active">
        <a class="nav-link" href="#">Home</a>
      </li>
    </ul>
</nav>
  );
}

export default Navbar;
